import React from 'react';

const ProfessionalPicture= () => {

    return(
        <div className="ProfessionalPicture">
            <div className="ImageWrapper"></div>

            <div className="nameContainer">
                <p className="name"> NAME NAME </p>
                <p className="profession"> PROFESSION PROFESSION </p>
            </div>

            <div className="blendContainer"></div>

            <div className="iconImageWrapper">

            </div>
        </div>
    );

};

export default ProfessionalPicture;
